import axios from 'axios';
import Api from '@/utils/Api';

export function createPNUser(data){
    Api.addPNUser(data)
        .then(res => {
            if(res.userId){
                alert('Subscription is Updated with User Id'+res.userId)
            }
        })
        .catch(err => {
            console.log("error is here",err)
        });
};
